import React from "react";
import icon from '../iconblue.png';

export function NavBar(props) {
    return (
        <nav>
            <a href="/"><img src={icon} alt="four circles around person" className="icon" /></a>
            <ul>
                <li><a href="/" aria-label="home">Home</a></li>
                <li><a href="/profile" aria-label="profile">Profile</a></li>
                <li><a href="/teams" aria-label="teams">Teams</a></li>
            </ul>
        </nav>
    );
}
